    false,nt"url": null,nt"notes": "This Water Resource Inventory and Assessment
    (WRIA) for Dale Bumpers White River National Wildlife Refuge summarizes available
    and relevant information for refuge water resources, including aquatic resource
    needs and issues of concern, both immediate and long-term. A primary purpose of
    the document is to provide recommendations to address any perceived water resource-related
    threats, needs or concerns on the refuge. Topics addressed within the WRIA report
    include the refugeu2019s natural setting (topography, climate, geology, soils, hydrology),
    effects of development within the associated watershed(s), potential effects from
    climate change, assessment and evaluation of refuge infrastructure in relation to
    water resources, historic and current water monitoring activities on and near the
    refuge, water quality and quantity information, and state water use regulatory guidelines.
    All of this information was compiled from publicly available reports (e.g., published
    and unpublished research reports), databases (e.g., websites maintained by government
    agencies, academic institutions, and non-governmental organizations), and geospatial
    datasets from federal, state, and local agencies.The primary drivers of the threats,
    needs, and issues of concern identified in this assessment are the anthropogenic
    and environmental stressors occurring within the White River Basin (including the
    White and Cache Rivers) and, to some degree, influences from the Arkansas and Mississippi
    Rivers, which are located at the extreme southern portion of the refuge. These areas
    together comprise the Region of Hydrologic Influence (RHI) for the refuge. For the
    purposes of this assessment, the RHI was defined as the Upper and Lower White Basins
    [six digit hydrologic unit code (HUC-6): 110100 and 080203, respectively], which
    encompass lands and waters upstream of the refuge, and the Lower Arkansas [080204]
    and Lower Mississippi-Helena [080201] Basins, located immediately downstream of
